import React from "react";

import './ListCity.css'

const listCity = [
  {
    "name": "Dublin",
    "subText": "123 properties",
    "image": "./images/city_1.webp"
  },
  {
    "name": "Reno",
    "subText": "533 properties",
    "image": "./images/city_2.webp"
  },
  {
    "name": "Austin",
    "subText": "532 properties",
    "image": "./images/city_3.webp"
  }
]



function ListCity() {
  return (
    <div className='listcity'>
      {listCity.map(city => (
        <div className='img-listcity' key={city['name']} >
          <img src={city['image']} with='100' />
          <div>
            <h2>{city['name']}</h2>
            <h4>{city['subText']}</h4>
          </div>
        </div>
      ))
      }
    </div>
  )
}


export default ListCity;
